import React from "react";
import {
  List,
  Datagrid,
  TextField,
  EditButton,
  DeleteButton,
  DateField,
  useRecordContext,
} from "react-admin";
import FilterSideBar from "../../Utils/FilterSideBar";

// const ListRegion = () => {
//   const record = useRecordContext();
//   console.log(record);
//   return record.regions.map((item, index) => <div key={index}>{item}</div>);
// };
const StorageLogList = (props) => {
  return (
    <List {...props} aside={<FilterSideBar />}>
      <Datagrid rowClick="edit">
        <TextField source="action" />
        <TextField source="blackFrames" />
        <TextField source="media" />
        <TextField source="destination" />

        <TextField source="note" />
        <TextField source="source" />
        <TextField source="timeLog" />
      </Datagrid>
    </List>
  );
};

export default StorageLogList;
